import React, {Component, Fragment} from "react";
import Bar from "../Components/Bar";
import Password from "./Password";

let strengthText = [
    {
        text: "Very Weak ☹",
        bgColor: "#e40808"
    },
    {
        text: "Weak ☹",
        bgColor: "#e40808"
    }, {
        text: "Medium ☹",
        bgColor: "#ffd800"
    }, {
        text: "Strong ☺",
        bgColor: "#2cb117"
    }, {
        text: "Very Strong ☻",
        bgColor: "#2cb117"
    }
];

class App extends Component {
    render() {
        return (
            <Fragment>
                <Bar/>
                <Password strength={strengthText}/>
            </Fragment>
        );

    }
}

export default App;
